import React from 'react'
import Game from './Game'

export default function GameGenre({ gamesGenre }) {
    
    console.log(gameGenre.genre)
    return (
        <div>
            {

                gamesGenre.map(gameGenre => {
                    return <Game name={gameGenre.genre} />
                })
            }
        </div>
    );
}
